import { StatusBar } from 'expo-status-bar';
import { SafeAreaView, Text, View } from 'react-native';
import { useTailwind } from 'tailwind-rn';

export default function App() {
  const tailwind = useTailwind();
  return (
    <SafeAreaView style={tailwind('flex-1 justify-center item-center ')}>
      <View >
        <Text style={tw('bg-blue-200 px-3 py-1 rounded-full')}>Open up App.js to start working on your app!</Text>

      </View>
    </SafeAreaView>
  );
}
